import React from "react";
import Phone from "./Phone";
import { Link } from "react-router-dom";
const Iphone = (props) => {
  return (
    <>
      {props.phone.map((phone, id) => (
        <Link to={`/blogs/${phone.id}`}>
          <Phone key={id} phone={phone} />
        </Link>
      ))}
    </>
  );
};

export default Iphone;
